import React, { useState } from "react";
import "./FormStyle.css";

const Form = () => {
  const [val, setVal] = useState({
    fName: "",
    eName: "",
    sName: "",
    mName: "",
  });

  const inputEvent = (e) => {
    const { name, value } = e.target;
    setVal((preVal) => {
      return {
        ...preVal,
        [name]: value,
      };
    });
  };
  return (
    <div className="form">
      <form>
        <label>Your Name</label>
        <input
          name="fName"
          value={val.fName}
          onChange={inputEvent}
          type="text"
        />
        <label>Email</label>
        <input
          name="eName"
          value={val.eName}
          onChange={inputEvent}
          type="email"
        />
        <label>Subject</label>
        <input
          name="sName"
          value={val.sName}
          onChange={inputEvent}
          type="text"
        />
        <label>Message</label>
        <textarea
          name="mName"
          value={val.mName}
          onChange={inputEvent}
          rows="6"
          placeholder="Type your message here..."
        />
        <button className="btn">Submit</button>
      </form>
    </div>
  );
};

export default Form;
